import React from 'react';
import Modal from '@mui/material/Modal';
import PersonIcon from '@mui/icons-material/Person';

const FeedbackModal = ({
  open,
  onClose,
  team,
  feedbacks,
  currentUser,
  scrollToBoth,
  onRematch,       // ‚úÖ Ï∂îÍ∞Ä
  onRequeue        // ‚úÖ Ï∂îÍ∞Ä
}) => {
  const isAllResponded = team.every(member => feedbacks[member.id]);
  const numPending = team.filter(member => !feedbacks[member.id]).length;
  const isUserInTeam = currentUser && team.some(member => member.id === currentUser.id);
  const isTeamSuccess = team.every(member => feedbacks[member.id] === 'üëç');
  const isUserInQueue = currentUser && team.some(member => member.id === currentUser.id);
  const shouldShowSavePrompt = currentUser && !isUserInTeam && !isUserInQueue;

  return (
    <Modal open={open} onClose={onClose}>
      <div style={{
        width: '90%',
        maxWidth: '600px',
        margin: '5% auto',
        backgroundColor: 'white',
        padding: '2rem',
        borderRadius: '12px',
        boxShadow: '0 4px 20px rgba(0,0,0,0.2)'
      }}>
        <h2 style={{
          fontWeight: 800,
          fontSize: '1.4rem',
          marginBottom: '1.2rem',
          color: '#FF6B35'
        }}>
          üß° ÎÇ¥ ÌåÄ ÌîºÎìúÎ∞± ÌòÑÌô©
        </h2>

        {isUserInTeam ? (
          <>
            {/* ÌåÄÏõê Î™©Î°ù */}
            <ul style={{ listStyle: 'none', padding: 0 }}>
              {team.map(member => {
                const status = feedbacks[member.id];
                let statusText = "‚è≥ ÎåÄÍ∏∞ Ï§ë";
                let statusColor = '#999';

                if (status === 'üëç') {
                  statusText = 'üëç ÌåÄÏóÖ!';
                  statusColor = '#2ECC71';
                } else if (status === 'üëé') {
                  statusText = 'üëé Îã§ÏùåÏóê..';
                  statusColor = '#999';
                }

                return (
                  <li key={member.id} style={{
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'space-between',
                    padding: '0.7rem 0',
                    borderBottom: '1px solid #eee'
                  }}>
                    <div style={{ display: 'flex', alignItems: 'center' }}>
                      <PersonIcon style={{ marginRight: '0.5rem' }} />
                      <strong>{member.name}</strong>
                    </div>
                    <span style={{ color: statusColor, fontWeight: 600 }}>
                      {statusText}
                    </span>
                  </li>
                );
              })}
            </ul>

            {/* ÏÉÅÌÉú Î©îÏãúÏßÄ + Î≤ÑÌäº */}
            <div style={{ textAlign: 'center', marginTop: '2rem' }}>
              {isAllResponded ? (
                <>
                  <p style={{ color: '#999', fontWeight: 400, marginBottom: '1rem' }}>
                    Î™®Îì† ÌåÄÏõêÏù¥ ÌîºÎìúÎ∞±ÏùÑ ÏôÑÎ£åÌñàÏäµÎãàÎã§!
                  </p>
                  {isTeamSuccess ? (
                    <>
                      <p style={{ color: '#2ECC71', fontWeight: 700 }}>
                        ‚úÖ Î™®ÎëêÏùò ÏùòÍ≤¨Ïù¥ Î∞òÏòÅÎêú ÌåÄÏù¥ ÏÉùÏÑ±ÎêòÏóàÏñ¥Ïöî
                      </p>
                      <button style={primaryButtonStyle}
                        onClick={() => window.open('/TeamPage', '_blank')} >
                        ÌåÄÎ£∏ÏúºÎ°ú Ïù¥ÎèôÌïòÍ∏∞
                      </button>
                    </>
                  ) : (
                    <>
                      <p style={{ color: '#E74C3C', fontWeight: 700 }}>
                        ‚ùå ÌåÄÏóÖÏóê Ïã§Ìå®ÌñàÏñ¥Ïöî
                      </p>
                      <div style={{ display: 'flex', justifyContent: 'center', gap: '1rem' }}>
                        <button style={primaryButtonStyle} onClick={onRematch}>
                          Ïû¨Îß§Ïπ≠ ÏãúÎèÑÌïòÍ∏∞
                        </button>
                        <button style={primaryButtonStyle} onClick={onRequeue}>
                          ÎåÄÍ∏∞Ïó¥ Ïù¥ÎèôÌïòÍ∏∞
                        </button>
                      </div>
                    </>
                  )}
                </>
              ) : (
                <p style={{ color: '#555', fontWeight: 400 }}>
                  ‚è≥ ÏïÑÏßÅ {numPending}Î™Ö ÌîºÎìúÎ∞± ÎåÄÍ∏∞ Ï§ëÏûÖÎãàÎã§
                </p>
              )}
            </div>
          </>
        ) : 
          shouldShowSavePrompt ? (
          <>
            <p style={{
              textAlign: 'center',
              marginTop: '1rem',
              fontSize: '1rem',
              color: '#555',
              fontWeight: 500
            }}>
              Î®ºÏ†Ä Team UpÏùÑ ÏßÑÌñâÌï¥Ï£ºÏÑ∏Ïöî!
            </p>
            <div style={{ textAlign: 'center', marginTop: '1.5rem' }}>
              <button
                onClick={() => {
                  onClose();
                  setTimeout(() => scrollToBoth(), 100);
                }}
                style={primaryButtonStyle}
              >
                ÎÇ¥ Ï†ïÎ≥¥ Ï†ÄÏû• ÌõÑ ÌåÄÏóÖÌïòÎü¨ Í∞ÄÍ∏∞
              </button>
            </div>
          </>
        ) : null}

        {/* Îã´Í∏∞ Î≤ÑÌäº */}
        <div style={{ textAlign: 'right', marginTop: '2rem' }}>
          <button
            onClick={onClose}
            style={{
              padding: '0.7rem 1.2rem',
              backgroundColor: '#FF6B35',
              color: 'white',
              border: 'none',
              borderRadius: '8px',
              cursor: 'pointer'
            }}
          >
            Îã´Í∏∞
          </button>
        </div>
      </div>
    </Modal>
  );
};

const primaryButtonStyle = {
  backgroundColor: '#FF6B35',
  color: 'white',
  padding: '0.8rem 1.5rem',
  border: 'none',
  borderRadius: '8px',
  fontWeight: 600,
  cursor: 'pointer'
};

export default FeedbackModal;
